    <script type="text/javascript">
        anime({
          targets: '.spe-drawing-demo line',
          strokeDashoffset: [anime.setDashoffset, 0],
          easing: 'easeInOutSine',
          duration: 1500,
          delay: function(el, i) { return i * 150 },
          direction: 'alternate',
          loop: true
        });
        
        anime({
          targets: '.spiral-drawing-demo path',
          strokeDashoffset: [anime.setDashoffset, 0],
          easing: 'easeInOutSine',
          duration: 1500,
          delay: function(el, i) { return i * 100 },
          direction: 'reverse',
          loop: true
        });

        anime({
          targets: '.line-drawing-demo polygon',
          strokeDashoffset: [anime.setDashoffset, 0],
          easing: 'easeInOutSine',
          duration: 1500,
          delay: function(el, i) { return i * 50 },
          direction: 'alternate',
          loop: true
        });

        var path = anime.path('.motion-path-demo path');

        anime({
          targets: '.motion-path-demo .el',
          translateX: path('x'),
          translateY: path('y'),
          rotate: path('angle'),
          easing: 'linear',
          duration: 10000,
          delay: function(el, i, l) {
            return i*280;
          },
          loop: true
        });
    </script>
    <style type="text/css">
        .motion-path-demo path { position: absolute; top: 100px; left: 100px; }
        .el { width: 4px; height: 5px; background: tomato; position: absolute; transform-origin: center; margin: 0; padding: 0;transform-origin: 0% 50%; border-radius: 10px; }
        .el:before { content: ""; width: 4px; height: 10px; background: rgba(223, 139, 123, 0.75); position: absolute; top: -10px; left: -7px; transform: skew(30deg); border-radius: 5px; }
        .el:after { content: ""; width: 4px; height: 10px; background: rgba(223, 139, 123, 0.75); position: absolute; top: 5px; left: -7px; transform: skew(-30deg); border-radius: 5px; }
        img { width: 100%; }
        .flex { flex-wrap: wrap; display: flex; }
        .flex>* { flex-grow: 1; }
        .parent { background: url("../imgs/dahlia.jpg") no-repeat; padding: 0; background-size: 100%; height: 100%; }
        .path { fill:none; stroke:#000000; stroke-miterlimit:10; stroke-dasharray: 300;
  stroke-dashoffset: 300; animation: dash 5s linear infinite forwards; }
        @keyframes dash {
          to {
            stroke-dashoffset: 0;
          }
